import React from 'react'
import Hero from "../components/Hero";
import Banner from "../components/Banner";

import { Link, useParams } from "react-router-dom";



export default function Rooms() {
    let {slug} = useParams();
    console.log({slug})
    return (
        <div>
            <Hero hero="roomsHero">
                <Banner title="rooms">
                    <Link to="/">
                        <button className="btn-primary">
                            Return Home
                        </button>
                    </Link>
                </Banner>
            </Hero>

        </div>
    )
}
